import React from 'react';
import {BrowserRouter,Switch, Route} from 'react-router-dom';


import Main from './main';

function Rountes(){
    <BrowserRouter>
        <Switch>
            <Route path='/' component={Main}/>

        </Switch>
    </BrowserRouter>

}

export default Route;
